Effugium καταφυγή II 345, 3; 503, 39. ἀποφυγή II 242, 34; 547, 23. qui de bello ad alteram partem transfugit IV 60, 14; V 192, 17; V 452, 60; IV 515, 35 (transit). locus refugii IV 231, 6. locus qui fugientem recipit IV 334, 54; V 568, 9. locus ubi fugiens accipitur uel qui fugientem suscipit V 452, 59. fuga, fugacitas: 'et effugium perit habent' (vel ab eis) V 192, 18 ('et eff.- peribit ab eis' Vulg. Iob 11, 20 Bucch.). 
effugia effugium est affectus fugae; 
ephebi necdum uiri, id est aduliscentuli. Lucanus (III 518): mixtis armabit efoebis (cf. ephebus et Verg. Aen. II 140) V 192, 16. V. ob nostra effugia.
